var EAuthentication;
(function (EAuthentication) {
  EAuthentication["RegistrationSignIn"] = "registrationSignIn";
  EAuthentication["RegistrationSignOut"] = "registrationSignOut";
  EAuthentication["Login"] = "login";
  EAuthentication["AdminLogin"] = "adminLogin";
  EAuthentication["Logout"] = "logout";
})(EAuthentication || (EAuthentication = {}));
var ECognitoOperation;
(function (ECognitoOperation) {
  ECognitoOperation["loginWithFacebook"] = "loginWithFacebook";
  ECognitoOperation["loginWithGoogle"] = "loginWithGoogle";
  ECognitoOperation["logout"] = "logout";
})(ECognitoOperation || (ECognitoOperation = {}));
export { EAuthentication, ECognitoOperation };
